import React, { Component } from 'react';
import './App.css';
import GameManager from './GameManager';
import { Route, Switch, Redirect, NavLink } from 'react-router-dom';

function App() {
    return ( <
        div className = "App" >
        <
        header className = "App-header" >
        <
        button href = "gameManager" > Hello < /button> <
        Switch >
        <
        Route exact path = "/"
        component = { Home }
        /> <
        Route path = "/about"
        component = { About }
        /> <
        Route path = "/contact"
        component = { Contact }
        /> <
        /Switch> <
        /header> <
        /div>
    );
}

export default App;
